function Categoria({ name, release_year, image }) {
  return (
    <div className="text-xl text-white">
      <div className="flex">{name}</div>
      {release_year}
      {image}
      <img src={require("./imagenes/poster/${image}.webp")} width={300} height={400} alt=''/>
    </div>
  );
}

export default Categoria;
